import Foundation

enum Triangle {
    
    class Solution {
        struct Pair: Hashable {
            let layerIndex: Int
            let index: Int
        }
        
        func minimumTotal(_ triangle: [[Int]]) -> Int {
            guard !triangle.isEmpty else { return 0 }
            var result: Int = .max
            var cache: [Pair: Int] = [:]
            for i in 0..<triangle.last!.count {
                result = min(result, calculateSum(layerIndex: triangle.count - 1, index: i, nums: triangle, sum: 0, cache: &cache))
            }
                
            return result
        }
        
        private func calculateSum(layerIndex: Int, index: Int, nums: [[Int]], sum: Int, cache: inout [Pair: Int]) -> Int {
            guard layerIndex > 0 else {
                return nums[layerIndex][0]
            }
            
            if let cachedValue = cache[Pair(layerIndex: layerIndex, index: index)] {
                return cachedValue
            }
            
            var result: Int = .max
            
            let array = nums[layerIndex]
            var cacheValue: Int = .max
            
            if 0..<array.count ~= index - 1 {
                let value = calculateSum(layerIndex: layerIndex - 1, index: index - 1, nums: nums, sum: sum, cache: &cache)
                result = min(
                    result,
                    min(array[index - 1], array[index]) + value
                )
                cacheValue = min(value, cacheValue)
            }
            if 0..<array.count ~= index + 1 {
                let value = calculateSum(layerIndex: layerIndex - 1, index: index, nums: nums, sum: sum, cache: &cache)
                result = min(
                    result,
                    min(array[index], array[index + 1]) + value
                )
                cacheValue = min(value, cacheValue)
            }
            
            cache[Pair(layerIndex: layerIndex, index: index)] = array[index] + cacheValue
            
            return array[index] + cacheValue
        }
    }
}

